import React, { Component } from 'react';
import './Home.css';
import '../Font/Font.css';
import NutritionixAPI from '../Images/NutritionixAPI.png';
import { NavLink} from 'react-router-dom';



class Footer extends Component {


  render() {




    return (
        <footer>
        <ul className= "social">

            <li className= "social_icon"> <a href="mailto:mailto:ultrayummprod@gmail.com?subject=Likes, dislikes, questions, a limerick...anything!" className = "noDeco" alt="subject"> <i className="fas fa-at black" alt= "Email" title="Email your feedback"></i></a>
            </li> 

            <li className= "social_icon">
            <NavLink
          to={`/policies`}>
          <i className="fas fa-info-circle black"></i> 
            </NavLink> 
            </li>

            <li className= "attribution"> <a href= "https://www.nutritionix.com" target= "_blank" rel="noopener noreferrer" className= "attribution"> 
              <img src= {NutritionixAPI} alt="Nutritionix" className= "attribution"/></a></li> 

      </ul>
    </footer>

    );
  }
}
export default Footer;
